    sections.sortable.forEach(function(sectionType, i) {
      if (mainSections.indexOf(sectionType) < 0) mainSections.splice(i, 0, sectionType);
    });
    // 2. remove sections that are not supported by the theme
    mainSections = mainSections.filter(function(sectionType) {
      return sections.sortable.indexOf(sectionType) >= 0
    })
