var Freezer = require('freezer-js');
var agent   = require("superagent");
var conf    = require("../helpers/conf.js");

/**
 * Stores are Monads
 */
var session = {
  freezer: new Freezer({
    token   : localStorage.getItem("token"),
    errors  : null
  }),
  login: login,
  logout: logout,
  updateLocale: updateLocale
};

function login(payload){
  agent.post(conf.endpoint("/token"))
    .auth(payload.email, payload.password)
    .end(function(errors, res){
      var mySession = session.freezer.get();
      if (errors) {
        localStorage.removeItem("token");
        mySession.set({ errors: res.body.details, token: null });
      } else {
        localStorage.setItem("token", res.body);
        // Note: while sync calls works it could cause a race condition
        mySession.set({ errors: null, token: res.body });
        session.freezer.once("update", function(){
          window.location.hash = "#/cvs";
        });
      }
    })
}

function logout () {
  localStorage.removeItem("token");
  session.freezer.get().set({errors: null, token: null});
  session.freezer.once("update", function(){
    window.location.hash = "#/welcome";
  });
}

function updateLocale(locale) {
  localStorage.setItem('locale', locale);
  window.location.reload(true);
}

module.exports = session;

